using System;
using System.Collections.Generic;using OpenQA.Selenium;using OpenQA.Selenium.Chrome;using OpenQA.Selenium.Support.UI;namespace FetchRewards    {
    class Program        {
        static void Main(string[] args)            {            //starting a driver and wait            IWebDriver driver = new ChromeDriver();            WebDriverWait wait = new WebDriverWait(driver, TimeSpan.FromSeconds(5));            var browser = new Browser(driver, wait);            var alertMessage = browser.NavigateTo<HomePage>("http://ec2-54-208-152-154.compute-1.amazonaws.com/")                 .FindFakeBarPosition()                 .ClickCoin()                 .GetAlertText();            //printing alert message            Console.WriteLine(alertMessage);            //killing a browser            browser.KillBrowser();            }        }    }
